const PreFlight = ()=>{
    return(
        <div className='PreFlight'>
            <h1>Capstone 2: PreFlight</h1>
            <div >
                <p className='p'>This app is intended to help travelers prepare for flight delays and stay informed.Users can retrieve the latest weather predictions for their departure and arrival destinations. These predictions will be decoded from TAF reports that pilots use to prepare for departures and these predictions are valid for up to 30 hours. If a user wishes they can recieve hourly weather updates for their departure and arrival locations. Users may also schedule notificiations to be sent prior to a future trip by setting a start and end day and time. </p>
            </div>
        </div>
    )
}

export default PreFlight;
